import Footer from "../../components/Footer";
import Header from "../../components/Header";

import {
  ContainerLogin,
  ContainerInfosBook,
  InputChangeImage,
  ContainerInputs,
  ContainerButtonLogin,
  InputEditBook,
  ButtonSubmitLogin,
  Title
} from "./styles";

const Login = () => {

  function login(e) {
    //previne reload à pagina
    e.preventDefault();
    console.log("add book");
  }

 return (
    <>
      <Header />
      {login ? (
        <>
          <Navigate to="/gallery" replace={true} />
        </>
      ) : (
        <ContainerFormLogin>
          <ToastContainer />

          <FormLogin onSubmit={handleSubmit}>
            <InputProfile
              placeholder="Email"
              name="email"
              type="text"
              ref={emailRef}
              required
            ></InputProfile>
            <InputProfile
              placeholder="Password"
              name="passwUser"
              type="password"
              ref={passwordRef}
              required
            ></InputProfile>
            <ContainerAllButtons>
              <ContainerButton>
                <ButtonLogin type="submit">Login</ButtonLogin>
              </ContainerButton>
              <ContainerButton>
                <ButtonRegister type="button" onClick={registerButton}>
                  Register
                </ButtonRegister>
              </ContainerButton>
            </ContainerAllButtons>
          </FormLogin>
        </ContainerFormLogin>
      )}
      <Footer />
    </>
  );
};

export default Login;
